import styles from "./UploadDataNavBar.module.css";

function UploadDataNavBar(){

    return(
        <div class={styles.navBar}>
            <div>생산 계획</div>
            <div>마스터</div>
            <div>BOM</div>
            <div>재고</div>
            <div>예약 내역</div>
            <div>구매 내역</div>
            <div>시험 내역</div>
        </div>
    );
}

export default UploadDataNavBar;
